import React from 'react';
import styles from './Line.module.scss';
const Line = () =>{
    return(
        <div>
        <div className={styles.line}>
            <div className={styles.button}></div>
            <div className={styles.right}></div>
        </div>
        </div>
    )
}

export default Line;
